(1347, 28, 110, 444, 'Grapes', 'aumfoodexports@gmail.com', '110', '/kg', '1 Year', 'all', 'New', '\r\nGrapes are small, sweet, and juicy fruits that come in a variety of colors, including green, red, and purple. Rich in antioxidants, particularly resveratrol, grapes are known for their numerous health benefits, including supporting heart health, improving circulation, and boosting the immune system. They are also a great source of vitamins C and K, as well as fiber, making them a refreshing and ', 'Supplier', 'grapes.jpg', '2024-12-17 09:35:27', 'product'),
(1348, 28, 110, 444, 'Guava', 'aumfoodexports@gmail.com', '115', '/kg', '1 Year', 'all', 'New', '\r\nGuava is a tropical fruit known for its vibrant color, sweet-tart flavor, and impressive nutritional profile. Packed with vitamin C—far more than most citrus fruits—guava is excellent for boosting immunity, improving skin health, and promoting digestion. The fruit is rich in fiber, antioxidants, and essential vitamins like A and B6, making it a powerhouse for overall health. Guavas can be enjoye', 'Supplier', 'guava.jpg', '2024-12-17 09:45:40', 'product'),
