(1357, 28, 110, 262, 'Spray Dried Apple Powder', 'aumfoodexports@gmail.com', '630', '/kg', '1 Year', 'all', 'New', 'Apple powder is a versatile, dehydrated form of apples that retains much of the flavor and nutritional value of fresh fruit. Created by drying and grinding apples into a fine powder, it is often used in baking, smoothies, snacks, and beverages as a natural flavoring agent. Apple powder is rich in dietary fiber, vitamins such as Vitamin C, and minerals like potassium, making it a nutritious additio', 'Supplier', 'apple powder.jpg', '2024-12-18 04:50:20', 'product'),
(1358, 28, 110, 262, 'Tamarind Powder', 'aumfoodexports@gmail.com', '700', '/kg', '1 Year', 'normal', 'New', 'Tamarind is a tangy and sweet fruit that grows in tropical regions. The tamarind tree produces long, brown pods containing a sour pulp. This pulp is commonly used in a variety of culinary dishes such as chutneys, pickles, sauces, and beverages. Tamarind is rich in vitamin C, calcium, phosphorus, and antioxidants, making it beneficial for digestion, boosting energy levels, and strengthening the imm', 'Supplier', 'tamarind.jpg', '2024-12-18 04:54:37', 'product'),
